ArtScience Museum is thrilled to announce our latest exhibition, Disney: Magic of Animation, opening 26 October 2019. Uncover the magic behind Walt Disney Animation Studios‚Äô most beloved animated movies from Steamboat Willie (1928) to classic films such as Snow White and the Seven Dwarfs (1937) and blockbusters such as Frozen (2013) and Zootopia (2016). Shown in Southeast Asia for the first time, this landmark exhibition features over 500 exceptional art pieces, including original drawings, paintings, sketches and concept art curated by the Walt Disney Animation Research Library. Come experience over 90 magical years of Disney animation with highlights including the debut of original artworks from the highly-anticipated film, Frozen 2.

